import React, { Component } from "react";
import Nav from "./Nav";

class App extends Component {
  render() {
    return (
      <div>
        <Nav
          url="https://github.com"
          icon="fa-brands fa-github"
          title=" Github"
        />


      </div>
    );
  }
}

export default App;
